import React from 'react';
import './header.css';
import Emblem from '../../../media/emblem-img.png';
import {Row, Col, Image} from 'react-bootstrap';

function header() {
    return (
        <header className = "header" id = "home">
            <Row>
                <Col>
                    <Image src = {Emblem}></Image>
                </Col>
            </Row>    
        </header>
    )
}

export default header
